import React, { useContext } from "react";
import CartIcon from "../../Assets/AddToCartIcon";
import "./Cart.css";
import { AddCartContext } from "../../Store/AddtoCartContext";

function Cart() {
  const { productDetails } = useContext(AddCartContext);
  return (
    <div>
      <div className="cart">
        <div className="heading">
          <span>Your Cart</span>
          <CartIcon></CartIcon>
        </div>
        <div className="cards">
          {productDetails.map((products) => {
            <div className="card">
              <div className="favorite"></div>
              <div className="image">
                <img src={products.i} alt="" />
              </div>
              <div className="content">
                <p className="rate">&#x20B9; 250000</p>
                <span className="category">Two Wheeler</span>
                <p className="name"> YAMAHA R15V3</p>
              </div>
              <div className="date">
                <span>10/5/2021</span>
              </div>
            </div>;
          })}
        </div>
      </div>
    </div>
  );
}

export default Cart;
